import React from 'react';
import "./sidebar.scss";

const Sidebar = () => {
  return (
    <>
      <div className="logo">
        <img src={process.env.PUBLIC_URL + "/assets/logo.jpg"} alt="logo" className='logo__image'/>
        <h1 className='logo__title'>Online Asset Management</h1>
      </div>
      <div className="sidebar">
        <ul className="sidebar__list">
          
          <li className="sidebar__list-item">
            <a href="#" className="sidebar__list-item-link">
              <i className="fas fa-home"></i>
              <span className="sidebar__list-item-text">Home</span>
            </a>
          </li>
        </ul>
      </div>
    </>
  );
};

export default Sidebar;
